import React from "react";
import { NavLink } from "react-router-dom";
import { ServiceWrapper } from "./style";
const Service = props => {
  return(
    <ServiceWrapper className="service">
      <div className="container">
        <NavLink
        className="link-to"
        exact
        to="/"
        ></NavLink>
      </div>
    </ServiceWrapper>
  );
}
export default Service;
